import React from 'react'
import Todo from './Todo.js'

export function TodoList({ todos }){
    return (
        <div>
            {todos.map((todo, index) => {
                return (
                    <Todo
                        // editTodo={editTodo}
                        // deleteTodo={deleteTodo}
                        key={todo.id}                        
                        todo={todo}
                  />
                )
              })}
        </div>
    )
}


export default TodoList
